#!/usr/bin/env node

const { program } = require("commander");
const analyze = require("../lib/analyze");
const process = require("process");
const { serveDashboard } = require("../lib/server");

program
  .command("analyze [path]")
  .option("-p, --port <port>", "Port to run the dashboard on", "8080")
  .description("Run code analysis on the specified project directory")
  .action((path, options) => {
    const projectPath = path || "./";
    analyze(projectPath)
      .then(() => {
        console.log("Analysis completed, starting dashboard...", options);

        serveDashboard(options?.port);
      })
      .catch((error) => {
        console.error("Error running analysis:", error);
      });
  })
  .command("reload server")
  .description("Reload the server with all the new changes")
  .action(() => {
    serveDashboard();
  });

program.parse(process.argv);

const report = require("../reports/eslint-report.json"); // Load the ESLint report
const fs = require("fs");

// Log the report data for verification
console.log("DATA REPORT :::==", report);

// Convert the report to a string format (JSON)
const reportString = JSON.stringify(report, null, 2); // Pretty print with 2 spaces

// Write the parsed report to a new file
const outputPath = "./parsedOutput.js"; // Define the output file path
fs.writeFileSync(outputPath, reportString); // Write the string to the file

// index.js
const analyze = require("./lib/analyze");
// const lint = require("./lib/lint");
// const test = require("./lib/test");

module.exports = {
  analyze,
  //   lint,
  //   test,
};

const { execSync } = require("child_process");
const path = require("path");
const { getLinesOfCode } = require("./cloc");

const analyze = async (projectPath) => {
  try {
    console.log(`Running ESLint analysis on ${projectPath}...`);
    const absolutePath = path.resolve(projectPath); // Ensure the path is absolute

    // Change directory to the project path and run npm run lint
    execSync(`cd ${absolutePath} && npm run lint`, {
      stdio: "inherit",
      shell: true,
    });

    console.log("ESLint analysis completed and report generated.");
  } catch (error) {
    // Check if the error is due to a non-zero exit code from ESLint
    if (error.status === 1) {
      console.warn("ESLint found issues, but the analysis completed.");

      // Counting number of lines of code in project
      await getLinesOfCode(projectPath);
      // Optionally, you can log the error message or any other details if needed
    } else {
      console.error("Error running analysis: ", error.message);
    }
  }
};

module.exports = analyze;

const { execSync } = require("child_process");
const fs = require("fs");
const path = require("path");
const { createSpinner } = require("./spinner");

const getLinesOfCode = (projectPath) => {
  console.log("Counting line of codes... on path:", projectPath);
  const spinner = createSpinner();
  try {
    const excludeListPath = path.join(__dirname, "../exclude-list.txt");

    const result = execSync(
      `npx cloc ${projectPath} --exclude-dir=node_modules --exclude-list-file=${excludeListPath} --json`
    );
    fs.writeFileSync(
      path.join(__dirname, "../reports/line-of-code.json"),
      result
    );
  } catch (error) {
    throw new Error(`Error while counting lines of code... ${error}`);
  } finally {
    spinner.stop();
  }
};

module.exports = { getLinesOfCode };

const express = require("express");
const path = require("path");

const serveDashboard = (port) => {
  const app = express();

  app.use(express.static(path.join(__dirname, "../frontend/dist")));

  app.get("*", (req, res) => {
    res.sendFile(path.join(__dirname, "../frontend/dist", "index.html"));
  });

  app.listen(port, () => {
    console.log(`Dashboard is running on http://localhost:${port}`);
  });
};

module.exports = { serveDashboard };

function createSpinner() {
  const spinnerChars = ["|", "/", "-", "\\"];
  let currentChar = 0;

  const spinnerInterval = setInterval(() => {
    process.stdout.write(`\rLoading... ${spinnerChars[currentChar]}`);
    currentChar = (currentChar + 1) % spinnerChars.length;
  }, 100);

  return {
    stop: () => {
      clearInterval(spinnerInterval);
      process.stdout.write("\rDone!          \n"); // Clear the line
    },
  };
}

module.exports = { createSpinner };
